inp=""

lowest = []
done = 0
for i in 'abcdefghijklmnopqrstuvwxyz':
	l = list(inp)
	
	while i in l:
		l.remove(i)
	while i.upper() in l:
		l.remove(i.upper())
	
	while True:
		toRemove = []
		for i in range(len(l)-1):
			if l[i].lower() == l[i-1].lower() and i != 0 and l[i-1] != l[i]:
				
				if i not in toRemove and i-1 not in toRemove:
					toRemove.append(i)
					toRemove.append(i-1)
					deleted = True
		
		for i in sorted(toRemove, reverse=True):
			del l[i]

		if not deleted:
			break
		toRemove = []
		deleted = False
	lowest.append(len(l))
	done += 1
	print(f"finished: {done}")

print(min(lowest))

	